import {
  Button,
  Popover,
  PopoverBody,
  PopoverHeader,
  UncontrolledPopover,
  CloseButton,
} from "reactstrap";
import { useState } from "react";
import Cart from "./cart";

export default function PopOver() {
  const [close, setClose] = useState(null);
  return (
    <div>
      <Button
        className=' mt-2'
        color='primary'
        id='popover644119284'
        type='button'
        onClick={setClose(false)}>
        Popover on top
      </Button>
      <UncontrolledPopover
        placement='top'
        target='popover644119284'>
        <PopoverBody>
          <CloseButton onClick={setClose(true)} />
          <Cart />
        </PopoverBody>
      </UncontrolledPopover>
    </div>
  );
}
